  [],\n\t\"num_tags\": 0,\n\t\"name\": \"current-direction-and-wind-wave-spectra-data-from-moored-current-meter-casts-in-the-gulf-of-mexb28e7\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Current direction, salinity, and wind wave
  spectra data were collected using moored current meter casts in the Gulf of Mexico
  from February 2, 1978 to January 31, 1979. Data were submitted by Texas A&M University
  as part of the Brine Disposal project. Data has been been processed by NODC to the
  NODC standard F005- Current Meter Data, F123- Fish Shellfish Resources, and F191-
  Wave Wind Spectra formats. Full format descriptions are available from NODC homepage
  at http://www.noaa.nodc.gov.nnThe F005 format is used for time series measurements
  of ocean currents obtained using moored current-measuring instruments, principally
  Aanderaa current meters (manufactured by Aanderaa Instruments Inc.). These data
  represent the Eulerian method of current measurement, i.e., the meters are deployed
  at a fixed mooring point and measure flow past the sensor. Position, water depth,
  and sensor depth are reported for each station. The data record comprises values
  of current direction and speed at specified date and time. Data values may be subject
  tonaveraging or filtering and are typically reported at 10-15 minute time intervals.
  Other environmental parameters may also be reported. These include: water temperature,
  salinity, conductivity, and transmissivity; wind direction and speed; and dominant
  wave direction, height, and period. A text field is available for optional comments.nnThe
  F123 format is used for data from field sampling of marine fish and shellfish. The
  data derive from analysis of midwater or bottom tow catches and provide information
  on population density and distribution. Cruise information, position, date, time,
  gear type, fishing distance and duration, and number of hauls are reported for each
  survey. Environmental data may include meteorological conditions, surface and bottom
  temperature and salinity, and current direction and speed. Bottom trawl or other
  gear dimensions and characteristics are also reported. Catch statistics (e.g., weight,
  volume, number of fish per unit volume) may be reported for both total haul and
  for individual species. Biological characteristics of selected specimens, predator/
  prey information (from stomach contents analysis), and growth data may also be included.
  A text record is available for comments.nnThe F191 format is used to report meteorological
  data and ocean wave spectra data from NDBO. The format contains seven data record
  types to: 1) Identify the buoy for position, duration, rate of sampling and heading.
  2) Identify the meteorological parameters (temperature, pressure, weather, solar
  radiation, and surface waves). 3) Report time series frequency, density and resolution
  of waves. Each record is 120 characters in length, sorted by station and record
  type. The first nine columns for all records are to be used for file type (columns
  1-3) and file identifier (column 4-9). The file identifier, to be assigned by the
  originator, is an unique originator id for each data submission. After submission,
  the NODC reassigns to this field an unique NODC identifier.\",\n\t\"owner_org\":
